import React from "react";
import { useParams } from "react-router-dom";
import "./DeatailInformation.css";

function DetailInformation({ data }) {
  const params = useParams();
  console.log(params);
  const newData = data[params.capsule_id];
  console.log(newData);
  return (
    <div className="detail-container">
      <h2>Details for Capsule: {newData.capsule_serial}</h2>
      <div className="detail-grid">
        <div>
          <p>
            <strong>Capsule ID:</strong> {data.capsule_id}
          </p>
          <p>
            <strong>Status:</strong> {data.status}
          </p>
          <p>
            <strong>Original Launch:</strong>{" "}
            {new Date(data.original_launch).toLocaleDateString()}
          </p>
        </div>
        <div>
          <p>
            <strong>Type:</strong> {data.type}
          </p>
          <p>
            <strong>Landings:</strong> {data.landings}
          </p>
          <p>
            <strong>Reuse Count:</strong> {data.reuse_count}
          </p>
        </div>
      </div>
      <h3>Missions:</h3>
      <ul>
        {data?.missions?.map((mission, index) => (
          <li key={index}>
            <strong>Mission Name:</strong> {mission.name} |{" "}
            <strong>Flight:</strong> {mission.flight}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DetailInformation;
